import React,{useState} from 'react';
import { useNavigate } from 'react-router-dom';
import Sidebar from './Sidebar';
import { Table, Button, Flex, Tooltip } from 'antd';
import {MenuUnfoldOutlined, PlusOutlined, BarsOutlined} from "@ant-design/icons";
import {Card, Space} from 'antd';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSearch } from '@fortawesome/free-solid-svg-icons';
import {data} from '../JSON data/userschart';
import '../dashboard.css';
import Userformfilter from '../Filters/userformfilter';

const Custodians = () => {
const [open, setOpen] = useState(false);
const showUserformfilter =() =>{
  console.log("button clicked");
  setOpen(true);
};

const closeUserformfilter =() => {
  setOpen(false);
};

const navigate = useNavigate(); 


  const handleLogout = (e) => {
    e.preventDefault();

    console.log('Logging out');
    navigate('/login');
  };

  const columns = [
    {
    title: 'ID',
    dataIndex: 'id',
    key: 'id',
},

{
    title: 'NAME',
    dataIndex: 'name',
    key: 'name',
},
{
    title: 'ASSET_TYPE',
    dataIndex: 'asset_type',
    key: 'asset_type',
},
{
    title: 'SERIAL_NO',
    dataIndex: 'serial_no',
    key: 'serial_no',
},
{
    title: 'OS',
    dataIndex: 'os',
    key: 'os',
},
{
    title: 'MODEL',
    dataIndex: 'model',
    key: 'model',
},
{
    title: 'VENDOR',
    dataIndex: 'vendor',
    key: 'vendor',
},
{
    title: 'SOFTWARE',
    dataIndex: 'software',
    key: 'software',
},
{
    title: 'DATE',
    dataIndex: 'date',
    key: 'date',
},
];

  return (

    <div className="dashboard_wrapper">
      {open && <Userformfilter openModal={open} onModalClose={closeUserformfilter}/>}
    <Sidebar/>

          <div className="Header">
          <button className="topnav-right" onClick={handleLogout}>Out</button>
              <h2 className="dashboard-h2">Custodians</h2>
             </div>

                <div className="dashboardpage">
                <div className="sidebar-footer">
        <div className="search-bar">
          <input type="text" placeholder="Search..." />
          <button>
            <FontAwesomeIcon icon={faSearch} />
          </button>
        </div>
      </div>
                <Space className="Filters">
                  <Card >
                    <Space>
                      <MenuUnfoldOutlined className= "icon asset-icon"/>
                    </Space>
                  </Card>

                  <Card className="Filters">
                    <Space>
                      <BarsOutlined className= "icon asset-icon"/>
                    </Space>
                  </Card>

                  <Card className="Filters">
                    <Space>
                    <Flex gap="large" vertical>
                      <Flex wrap gap="large">
                      <Tooltip title="Add Asset">
                      <Button type="text" shape="triangle" icon={<PlusOutlined className= "icon asset-icon"

                      />}
                      onClick={showUserformfilter }
                      />

                      </Tooltip>
                      </Flex>
                    </Flex>
                    </Space>
                  </Card>

                </Space>
                </div>

                <Table className="assetbox"
                    dataSource={data}
                    columns={columns}
                    rowKey="id"
                    pagination={{ pageSize: 7 }}
                />
     </div>


  );
};


export default Custodians;
